import React from "react";

const SearchBar = () => {
  return (
    <div className="flex flex-row items-center rounded-l ">
      <input
        className="h-8 flex items-center  text-start p-2 text-black font-serif text-sm"
        type="search"
        size="50"
        placeholder="Search Movie / Tv Show / Actors "
      />

      <button className="text-black font-bold p-2">Search</button>
    </div>
  );
};

export default SearchBar;
